webpackJsonp([39050397943639],{4846:function(e,t){e.exports={pathContext:{group:[{node:{fields:{title:"Christopher's Homemade Berliner",date:"31 Aug 2007",slug:"/2007-08-31-christophers-homemade-berliner/",tags:"Y2007"},html:'<p><a href="http://www.flickr.com/photos/papascott/1283116694/" title="Photo Sharing"><img src="https://farm2.static.flickr.com/1201/1283116694_cfe4e4c199.jpg" width="500" height="375" alt="CIMG0110" /></a></p>\n<p>Christopher\'s homemade Berliner. All the goodness of a bakery Berliner without being cooked in lard.</p>\n<ul>\n<li>1 "normal" <em>Brötchen</em> (known in these parts as a <a href="http://de.wikipedia.org/wiki/Rundst%C3%BCck"><em>Rundstück</em></a>)</li>\n<li>Strawberry jam</li>\n<li>Powdered sugar</li>\n</ul>\n<p>Bore a hole in the <em>Brötchen</em> with the kitchen utensil of your choice. Fill with jam, and sprinkle with powdered sugar. Enjoy, but please wipe up the powdered sugar from the table when you\'re done.</p>'},next:{fields:{title:"Big Mac Pulling",date:"31 Aug 2007",slug:"/2007-08-31-big-mac-pulling/"}},previous:{fields:{title:"Web 0.1",date:"01 Sep 2007",slug:"/2007-09-01-web-01/"}}},{node:{fields:{title:"Big Mac Pulling",date:"31 Aug 2007",slug:"/2007-08-31-big-mac-pulling/",tags:"Y2007"},html:'<p><a href="http://www.bigmac-pulling.de/"><img src="http://www.papascott.de/wordpress/wp-content/uploads/2007/08/big-mac-pulling.jpg" alt="Big Mac Pulling" /></a></p>\n<p>A couple of weeks ago the <a href="http://www.mcc-nordheide.de/">Mini-Car-Club Nordheide</a> asked us if we\'d like to sponsor an event on the vacant lot next to our restaurant. The idea was so wild we just had to say yes... a pulling contest for remote-controlled models (1:5/1:6) featuring a 60 cm replica of a Big Mac with up to 22 kg. The <a href="http://www.bigmac-pulling.de/">Big Mac Pulling</a> will take place on Sunday, September 30, 9:00 to 18:00. Buchholz has Sunday shopping on that day as well, so those not interested in cars and dirt will have something to do as well.</p>\n<p><a href="http://www.bigmac-pulling.de/"><img src="http://www.papascott.de/wordpress/wp-content/uploads/2007/08/big-mac-pulling-flyer.jpg" alt="Big Mac Pulling Fyer" /></a></p>'},next:{fields:{title:"Baby A",date:"25 Aug 2007",slug:"/2007-08-25-baby-a/"}},previous:{fields:{title:"Christopher's Homemade Berliner",date:"31 Aug 2007",slug:"/2007-08-31-christophers-homemade-berliner/"}}},{node:{fields:{title:"Baby A",date:"25 Aug 2007",slug:"/2007-08-25-baby-a/",tags:"Y2007"},html:"<p>We've only been in business 7 weeks, and we already have our first new baby. Baby A was born yesterday, a healthy boy, and our joy is doubled since both father and mother are on our payroll. Welcome to the world!</p>"},next:{fields:{title:"In Common",date:"24 Aug 2007",slug:"/2007-08-24-in-common/"}},previous:{fields:{title:"Big Mac Pulling",date:"31 Aug 2007",slug:"/2007-08-31-big-mac-pulling/"}}}],pathPrefix:"",first:!1,last:!1,index:109,pageCount:1101}}}});
